import React, { useState } from "react";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";

const Register = () => {
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [email, setEmail] = useState("");
  const [username, setUserName] = useState("");
  const [password, setPassword] = useState("");

  const handleFirstName = (e) => {
    console.log(e.target.value);
    setFirstName(e.target.value);
  }

  const handleLastName = (e) => {
    setLastName(e.target.value);
  }

  const handleEmail = (e) => {
    setEmail(e.target.value);
  }

  const handleUsername = (e) => {
    setUserName(e.target.value);
  }

  const handlePassword= (e) => {
    setPassword(e.target.value);
  }

  return (
    <>
    <Form>
    <Form.Group className="mb-3" controlId="formBasicEmail">
      <Form.Label>First name</Form.Label>
      <Form.Control type="email" placeholder="Enter your first name" value={firstName} name="firstName" onClick={handleFirstName} />
    </Form.Group>
    <Form.Group className="mb-3" controlId="formBasicEmail">
      <Form.Label>Last name</Form.Label>
      <Form.Control type="email" placeholder="Enter last name" value={lastName} />
    </Form.Group>
    <Form.Group className="mb-3" controlId="formBasicEmail">
      <Form.Label>Email</Form.Label>
      <Form.Control type="email" placeholder="Enter email" value={email}/>
    </Form.Group>
    <Form.Group className="mb-3" controlId="formBasicEmail">
      <Form.Label>Username</Form.Label>
      <Form.Control type="email" placeholder="Enter username" value={username} />
    </Form.Group>
    <Form.Group className="mb-3" controlId="formBasicPassword">
      <Form.Label>Password</Form.Label>
      <Form.Control type="password" placeholder="Password" value={password}/>
    </Form.Group>
    <Form.Group>
    <Button variant="primary" type="submit">
      Register
    </Button>
    <Form.Text id="cancel-form"> or <span className="cancel-form" >Cancel</span></Form.Text>
    </Form.Group>
   </Form>
    </>
  )
}

export default Register;
